Here's a step-by-step guide to creating a web app using React, Node.js, and Express.js, and deploying it on Heroku:

1. Set up the project:
   - Create a new directory for your project.
   - Open a terminal and navigate to the project directory.
   - Run `npm init` to initialize a new Node.js project and follow the prompts.

2. Set up the backend:
   - Create a new directory named `server` inside the project directory.
   - Navigate to the `server` directory.
   - Run `npm install express` to install Express.js.
   - Create a new file named `server.js` inside the `server` directory.
   - Open `server.js` and set up a basic Express.js server:

     ```javascript
     const express = require('express');
     const app = express();

     app.get('/', (req, res) => {
       res.send('Hello from the server!');
     });

     const port = process.env.PORT || 5000;
     app.listen(port, () => {
       console.log(`Server is running on port ${port}`);
     });
     ```

3. Set up the frontend:
   - Navigate back to the project directory.
   - Run `npx create-react-app client` to create a new React app named `client`.
   - Navigate to the `client` directory.
   - Run `npm start` to start the React development server.

4. Create a proxy for API requests:
   - Open the `package.json` file in the `client` directory.
   - Add the following line to the file:

     ```json
     "proxy": "http://localhost:5000"
     ```

   - This will allow the React app to make API requests to the Express.js server during development.

5. Create a component for adding and displaying dummy data:
   - Create a new file named `DummyData.js` inside the `client/src` directory.
   - Open `DummyData.js` and create a React component that allows adding and displaying dummy data:

     ```jsx
     import React, { useState } from 'react';

     const DummyData = () => {
       const [data, setData] = useState([]);
       const [input, setInput] = useState('');

       const handleSubmit = (e) => {
         e.preventDefault();
         setData([...data, input]);
         setInput('');
       };

       return (
         <div>
           <h2>Dummy Data</h2>
           <form onSubmit={handleSubmit}>
             <input
               type="text"
               value={input}
               onChange={(e) => setInput(e.target.value)}
             />
             <button type="submit">Add</button>
           </form>
           <ul>
             {data.map((item, index) => (
               <li key={index}>{item}</li>
             ))}
           </ul>
         </div>
       );
     };

     export default DummyData;
     ```

   - Open `App.js` in the `client/src` directory and import the `DummyData` component:

     ```jsx
     import DummyData from './DummyData';

     const App = () => {
       return (
         <div>
           <h1>My App</h1>
           <DummyData />
         </div>
       );
     };

     export default App;
     ```

